INSERT INTO `pagebuilder__pages` VALUES (1,'Landing Page','master',NULL,'2020-12-03 13:17:52','2020-12-03 13:17:52'),(2,'About Us','master','{\"html\":[\"\"],\"components\":[[]],\"css\":\"* { box-sizing: border-box; } body {margin: 0;}\",\"style\":[],\"blocks\":{\"en\":[]}}','2020-12-03 13:17:52','2020-12-03 13:17:52'),(3,'How It Works','master',NULL,'2020-12-03 13:17:52','2020-12-03 13:17:52'),(4,'Terms and Condition','master','{\"html\":[\"[block slug=\\\"template-blog\\\" id=\\\"IDKPO3PG4XH0K8Z8\\\"]\"],\"components\":[[{\"tagName\":\"phpb-block\",\"content\":\"\",\"attributes\":{\"slug\":\"template-blog\",\"id\":\"IDKPO3PG4XH0K8Z8\"}}]],\"css\":\"* { box-sizing: border-box; } body {margin: 0;}.IDKPO3FNMOJUKNQ58{background-color:#ffffff;}\",\"style\":[{\"selectors\":[{\"name\":\"IDKPO3FNMOJUKNQ58\",\"label\":\"IDKPO3FNMOJUKNQ58\",\"type\":1,\"active\":true,\"private\":false,\"protected\":false}],\"style\":{\"background-color\":\"#ffffff\"}}],\"blocks\":{\"en\":{\"IDKPO3PG4XH0K8Z8\":{\"settings\":{\"attributes\":{\"style-identifier\":\"IDKPO3FNMOJUKNQ58\"}},\"blocks\":[],\"html\":\"<div class=\\\"IDKPO3FNMOJUKNQ58\\\">\\n    <div class=\\\"container\\\">\\n        <div class=\\\"nav-scroller py-1 mb-2\\\">\\n            <nav class=\\\"nav d-flex justify-content-between\\\"><\\/nav>\\n        <\\/div>\\n    <\\/div>\\n    <main class=\\\"container\\\">\\n        <div class=\\\"p-4 p-md-5 mb-4 text-white rounded bg-dark IDKPO3FNNLCQO0Q71\\\">\\n            <div class=\\\"col-md-6 px-0\\\">\\n                <h1 data-raw-content=\\\"true\\\" class=\\\"display-4 fst-italic\\\"><\\/h1>\\n                <p data-raw-content=\\\"true\\\" class=\\\"lead my-3\\\"><\\/p>\\n                <p data-raw-content=\\\"true\\\" class=\\\"lead mb-0\\\"><br><\\/p>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\\\"row mb-2\\\">\\n            <div class=\\\"col-md-6\\\">\\n                <div class=\\\"row g-0 border rounded overflow-hidden flex-md-row mb-4 shadow-sm h-md-250 position-relative\\\">\\n                    <div class=\\\"col p-4 d-flex flex-column position-static\\\"><strong data-raw-content=\\\"true\\\" class=\\\"d-inline-block mb-2 text-primary\\\">World<\\/strong>\\n                        <h3 data-raw-content=\\\"true\\\" class=\\\"mb-0\\\">Featured post<\\/h3>\\n                        <div class=\\\"mb-1 text-muted\\\">Nov 12<\\/div>\\n                        <p data-raw-content=\\\"true\\\" class=\\\"card-text mb-auto\\\">This is a wider card with supporting text below as a natural lead-in to additional content.<\\/p>\\n                        <p data-raw-content=\\\"true\\\"><a href=\\\"#\\\">Continue reading<\\/a><\\/p>\\n                    <\\/div>\\n                    <div class=\\\"col-auto d-none d-lg-block\\\"><img src=\\\"https:\\/\\/wallpapercave.com\\/wp\\/wp3194552.png\\\" width=\\\"200\\\" height=\\\"250\\\"><\\/div>\\n                <\\/div>\\n            <\\/div>\\n            <div class=\\\"col-md-6\\\">\\n                <div class=\\\"row g-0 border rounded overflow-hidden flex-md-row mb-4 shadow-sm h-md-250 position-relative\\\">\\n                    <div class=\\\"col p-4 d-flex flex-column position-static\\\"><strong data-raw-content=\\\"true\\\" class=\\\"d-inline-block mb-2 text-success\\\">Design<\\/strong>\\n                        <h3 data-raw-content=\\\"true\\\" class=\\\"mb-0\\\">Post title<\\/h3>\\n                        <div class=\\\"mb-1 text-muted\\\">Nov 11<\\/div>\\n                        <p data-raw-content=\\\"true\\\" class=\\\"mb-auto\\\">This is a wider card with supporting text below as a natural lead-in to additional content.<\\/p>\\n                        <p data-raw-content=\\\"true\\\"><a data-cke-saved-href=\\\"#\\\" href=\\\"#\\\" class=\\\"stretched-link\\\">Continue reading<\\/a><\\/p>\\n                    <\\/div>\\n                    <div class=\\\"col-auto d-none d-lg-block\\\"><img src=\\\"https:\\/\\/wallpapercave.com\\/wp\\/wp3194552.png\\\" width=\\\"200\\\" height=\\\"250\\\"><\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\\\"row\\\">\\n            <div class=\\\"col-md-8\\\">\\n                <h3 data-raw-content=\\\"true\\\" class=\\\"pb-4 mb-4 fst-italic border-bottom\\\">\\n                    From the Firehose\\n                <\\/h3>\\n                <article class=\\\"blog-post\\\">\\n                    <h2 data-raw-content=\\\"true\\\" class=\\\"blog-post-title\\\">Sample blog post<\\/h2>\\n                    <p data-raw-content=\\\"true\\\" class=\\\"blog-post-meta\\\">January 1, 2014 by <a href=\\\"#\\\">Mark<\\/a><\\/p>\\n                    <p data-raw-content=\\\"true\\\">This blog post shows a few different types of content that\\u2019s supported and styled with Bootstrap. Basic typography, images, and code are all supported.<\\/p>\\n                    <hr class=\\\"IDKPO3FNR85M7TM72\\\">\\n                    <p data-raw-content=\\\"true\\\">Yeah, she dances to her own beat. Oh, no. You could\'ve been the greatest. \'Cause, baby, <a href=\\\"#\\\">you\'re a firework<\\/a>. Maybe a reason why all the doors are closed. Open up your heart and just let it begin. So tr\\u00e8s chic, yeah, she\'s a classic.<\\/p>\\n                    <blockquote>\\n                        <p data-raw-content=\\\"true\\\">Bikinis, zucchinis, Martinis, no weenies. I know there will be sacrifice but that\'s the price. <strong>This is how we do it<\\/strong>. I\'m not sticking around to watch you go down. You think you\'re so rock and roll, but you\'re really just a joke. I know one spark will shock the world, yeah yeah. Can\'t replace you with a million rings.<\\/p>\\n                    <\\/blockquote>\\n                    <p data-raw-content=\\\"true\\\">Trying to connect the dots, don\'t know what to tell my boss. Before you met me I was alright but things were kinda heavy. You just gotta ignite the light and let it shine. Glitter all over the room <em>pink flamingos<\\/em> in the pool. <\\/p>\\n                    <h2 data-raw-content=\\\"true\\\">Heading<\\/h2>\\n                    <p data-raw-content=\\\"true\\\">Suiting up for my crowning battle. If you only knew what the future holds. Bring the beat back. Peach-pink lips, yeah, everybody stares.<\\/p>\\n                    <h3 data-raw-content=\\\"true\\\">Sub-heading<\\/h3>\\n                    <p data-raw-content=\\\"true\\\">You give a hundred reasons why, and you say you\'re really gonna try. Straight stuntin\' yeah we do it like that. Calling out my name. \\u2018Cause I, I\\u2019m capable of anything.<\\/p>\\n                    <pre><code>Example code block<\\/code><\\/pre>\\n                    <p data-raw-content=\\\"true\\\">Before you met me I was alright but things were kinda heavy. You just gotta ignite the light and let it shine.<\\/p>\\n                    <h3 data-raw-content=\\\"true\\\">Sub-heading<\\/h3>\\n                    <p data-raw-content=\\\"true\\\">You got the finest architecture. Passport stamps, she\'s cosmopolitan. Fine, fresh, fierce, we got it on lock. Never planned that one day I\'d be losing you. She eats your heart out.<\\/p>\\n                    <ul data-raw-content=\\\"true\\\">\\n                        <li>Got a motel and built a fort out of sheets.<\\/li>\\n                        <li>Your kiss is cosmic, every move is magic.<\\/li>\\n                        <li>Suiting up for my crowning battle.<\\/li>\\n                    <\\/ul>\\n                    <p data-raw-content=\\\"true\\\">Takes you miles high, so high, \'cause she\\u2019s got that one international smile.<\\/p>\\n                    <ol data-raw-content=\\\"true\\\">\\n                        <li>Scared to rock the boat and make a mess.<\\/li>\\n                        <li>I could have rewrite your addiction.<\\/li>\\n                        <li>I know you get me so I let my walls come down.<\\/li>\\n                    <\\/ol>\\n                    <p data-raw-content=\\\"true\\\">After a hurricane comes a rainbow.<\\/p>\\n                <\\/article>\\n                <article class=\\\"blog-post\\\">\\n                    <h2 data-raw-content=\\\"true\\\" class=\\\"blog-post-title\\\">Another blog post<\\/h2>\\n                    <p data-raw-content=\\\"true\\\" class=\\\"blog-post-meta\\\">December 23, 2013 by <a href=\\\"#\\\">Jacob<\\/a><\\/p>\\n                    <p data-raw-content=\\\"true\\\">I am ready for the road less traveled. Already <a href=\\\"#\\\">brushing off the dust<\\/a>. Yeah, you\'re lucky if you\'re on her plane. I used to bite my tongue and hold my breath. Uh, She\\u2019s a beast. I call her Karma (come back). Black ray-bans, you know she\'s with the band. I can\'t sleep let\'s run away and don\'t ever look back, don\'t ever look back.<\\/p>\\n                    <blockquote>\\n                        <p data-raw-content=\\\"true\\\">Growing fast into a <strong>bolt of lightning<\\/strong>. Be careful Try not to lead her on<\\/p>\\n                    <\\/blockquote>\\n                    <p data-raw-content=\\\"true\\\">I\'m intrigued, for a peek, heard it\'s fascinating. Oh oh! Wanna be a victim ready for abduction. She\'s got that international smile, oh yeah, she\'s got that one international smile. Do you ever feel, feel so paper thin. I\\u2019m gon\\u2019 put her in a coma. Sun-kissed skin so hot we\'ll melt your popsicle.<\\/p>\\n                    <p data-raw-content=\\\"true\\\">This is transcendental, on another level, boy, you\'re my lucky star.<\\/p>\\n                <\\/article>\\n                <article class=\\\"blog-post\\\">\\n                    <h2 data-raw-content=\\\"true\\\" class=\\\"blog-post-title\\\">New feature<\\/h2>\\n                    <p data-raw-content=\\\"true\\\" class=\\\"blog-post-meta\\\">December 14, 2013 by <a href=\\\"#\\\">Chris<\\/a><\\/p>\\n                    <p data-raw-content=\\\"true\\\">From Tokyo to Mexico, to Rio. Yeah, you take me to utopia. I\'m walking on air. We\'d make out in your Mustang to Radiohead. I mean the ones, I mean like she\'s the one. Sun-kissed skin so hot we\'ll melt your popsicle. Slow cooking pancakes for my boy, still up, still fresh as a Daisy.<\\/p>\\n                    <ul data-raw-content=\\\"true\\\">\\n                        <li>I hope you got a healthy appetite.<\\/li>\\n                        <li>You\'re never gonna be unsatisfied.<\\/li>\\n                        <li>Got a motel and built a fort out of sheets.<\\/li>\\n                    <\\/ul>\\n                    <p data-raw-content=\\\"true\\\">Don\'t need apologies. Boy, you\'re an alien your touch so foreign, it\'s <em>supernatural<\\/em>, extraterrestrial. Talk about our future like we had a clue. I can feel a phoenix inside of me.<\\/p>\\n                <\\/article>\\n                <nav aria-label=\\\"Pagination\\\" class=\\\"blog-pagination\\\"><a href=\\\"#\\\" class=\\\"btn btn-outline-primary IDKPO3FNWI2ZL1X73\\\">Older<\\/a><a href=\\\"#\\\" class=\\\"btn btn-outline-secondary IDKPO3FNWM6X0MR74\\\">Newer<\\/a><\\/nav>\\n            <\\/div>\\n            <div class=\\\"col-md-4\\\">\\n                <div class=\\\"p-4 mb-3 bg-light rounded IDKPO3FNWQH55OL75\\\">\\n                    <h4 data-raw-content=\\\"true\\\" class=\\\"fst-italic\\\">About<\\/h4>\\n                    <p data-raw-content=\\\"true\\\" class=\\\"mb-0\\\">Saw you downtown singing the Blues. Watch you circle the drain. Why don\'t you let me stop by? Heavy is the head that <em>wears the crown<\\/em>. Yes, we make angels cry, raining down on earth from up above.<\\/p>\\n                <\\/div>\\n                <div class=\\\"p-4\\\">\\n                    <h4 data-raw-content=\\\"true\\\" class=\\\"fst-italic\\\">Archives<\\/h4>\\n                    <ol data-raw-content=\\\"true\\\" class=\\\"list-unstyled mb-0\\\">\\n                        <li><a href=\\\"#\\\">March 2014<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">February 2014<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">January 2014<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">December 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">November 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">October 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">September 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">August 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">July 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">June 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">May 2013<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">April 2013<\\/a><\\/li>\\n                    <\\/ol>\\n                <\\/div>\\n                <div class=\\\"p-4\\\">\\n                    <h4 data-raw-content=\\\"true\\\" class=\\\"fst-italic\\\">Elsewhere<\\/h4>\\n                    <ol data-raw-content=\\\"true\\\" class=\\\"list-unstyled\\\">\\n                        <li><a href=\\\"#\\\">GitHub<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">Twitter<\\/a><\\/li>\\n                        <li><a href=\\\"#\\\">Facebook<\\/a><\\/li>\\n                    <\\/ol>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n    <\\/main>\\n<\\/div>\",\"is_html\":true}}}}','2020-12-03 13:17:52','2020-12-03 13:17:52'),(5,'Contact Us','master',NULL,'2020-12-03 13:17:52','2020-12-03 13:17:52'),(6,'Privacy','master',NULL,'2020-12-03 13:17:52','2020-12-03 13:17:52');
